const task  = [
    {
        id: 1,
        text: 'Doctor appointment',
        day: 'feb 1 at 1 30 pm',
        reminder: true,
    },
    {
        id: 2,
        text: 'Dentist appointment',
        day: 'march 10 at 2 30 pm',
        reminder: true,
    },
    {
        id: 3,
        text: 'WOrk appointment',
        day: 'april 11 at 11 30 pm',
        reminder: false,
    }
]

const Tasks = () => {
    return (
        <>
        {tasks.map((task) => (<h3>{task.text}</h3>))}
        </>
    )
}

export default Tasks
